#include <bits/stdc++.h>
using namespace std;
const long long int N = 2 << 30, eps = 1e-9;
void solve() {
  long long int n, u, v, x, y;
  cin >> n >> x >> y;
  int a = (x * (n - 1)) / 2;
  int b = x - y;
  int sum = 0;
  int cnt = 0;
  if (eps <= y) {
    if (b <= a && a >= 0 && y <= b) {
      sum += a / 2;
    }
    if (b < a && a < 0 && y >= a) {
      sum -= a / 2;
    }
  } else if (eps < y) {
    if (a <= b && a >= 0 && y <= b) {
      sum += a / 2;
    }
    if (b < a && a < 0 && y >= a) {
      sum -= a / 2;
    }
  }
  if (sum <= eps) {
    cnt = (x * y) % 2 + 1;
  } else {
    cnt = (a * (x - 1)) / 2 + 1;
  }
  cout << cnt << endl;
}
int32_t main() {
  ios_base::sync_with_stdio(0);
  cin.tie(0);
  long long int t, n, s, m, f, u, v, x, y, ans, flag;
  cin >> t;
  while (t--) solve();
  return 0;
